package com.arjun.leetcode._392_subsequence;

public class Solution {
    public boolean isSubsequence(String s, String t) {
        String newStr = "";
        for (int i = 0; i < s.length(); i++) {
            char c = t.charAt(i);
            if (s.contains(c + "")) newStr += c + "";
        }
        System.out.println(newStr);
        return s.equals(newStr);
    }

    public boolean isSubsequence1(String s, String t) {
        int point = 0;
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            int found = t.indexOf(c, point);
            if (found != -1) {
                point = found + 1;
            } else
                return false;
        }
        return true;
    }

    public static void main(String[] args) {
        Solution s = new Solution();
        System.out.println(s.isSubsequence1("leeeeetcode",
                ""));
    }
}
